const INITIAL_STATE = {
    respuestas: [], 
    cargando: false   
};

export default (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case 'traer_respuestas':
            return { ...state, respuestas: action.payload }
        case 'crear_respuesta':
            return {
                ...state,
                respuestas: action.payload
            }
        case 'editar_respuesta':
            return {
                ...state,
                respuestas: action.payload
            }
        case 'eliminar_respuesta':
            return {
                ...state,
                respuestas: action.payload
            }
        default:
            return state;
    }
}
